INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(1, 'Mart Järvik ei ilmunud korruptsioonivastase erikomisjoni ette ', 'Täna toimus korruptsioonivastane erikomisjon, mille ette kutsuti vastuseid andma maaeluminister Mart Järvik. Siiski ei ilmunud Järvik kohale.\r\nKorruptsioonivastase erikomisjoni juht Katri Raik kinnitas, et Järvik ei ilmunud kohale, aga see-eest andis vastuseid ministri kantsler Illar Lemetti.\r\n\r\nEile küsisid opositsiooniliikmed peaminister Jüri Ratta käest, kas tal õnnestuks lubada minister Järvik valitsuse istungilt mõneks ajaks ära. Ratas kemples otsese vastuse andmisel, aga lõpuks nõustus, et ta soovitab Järvikul komisjoni ette ilmuda.\r\n\r\nMinister pidi ilmuma komisjoni ette riigikogu kodu- ja töökorra seaduse kohaselt, mille kohaselt on komisjonil, ka erikomisjonil õigus nõuda valitsuse liikme osalemist komisjoni istungil.\r\n\r\nRaik ütles, et erikomisjon jätkab esmaspäeval tööd. Lisaks erikomisjonile uurib Järviku küsimust Ratta kokku kutsutud uurimiskomisjon, mis peaks tulevaks nädalaks otsustama, kas Järvik on tööd pädevalt teinud.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(2, 'MHOMMIKUNE ERISAADE | Kas Helmed süüdistasid Kaja Kallast tõesti \"Mary Krossi tegemises\"? Kas Tommi Mäkinen maksab Eestis hiigelpalku?', '20. sünnipäeva nädala puhul tervitab Delfi viiel hommikul oma kasutajaid erisaate hommikuväljaandega, vaadates otsa eelmise päeva, värske hommiku ja eelseisva päeva peamistele uudisteemadele.\r\nTäna olid hommikusaate stuudios Delfi päevatoimetaja Karoliina Vasli, Ärilehe ajakirjanik Siiri Liiva ja Delfi tegevtoimetaja Tarmo Paju, peateemadeks Kaja Kallase vastu suunatud ähvardused, värske Ärilehe artikkel Eestis tegutsevast Tommi Mäkineni rallitiimist ja uued poliitreitingud.\r\n\r\nEeloleval laupäeval täitub Delfil 20. tegevusaasta.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(3, 'Politseikopter leidis rappa jõhvikaid korjama läinud mehe üles', 'Politsei sai eile õhtul teate, et sama päeva pärastlõunal Ida-Virumaal Kassisaare rappa jõhvikale läinud 63-aastane mees pole koju naasnud. Mehe leidis täna sügavalt rabast politseikopter.\r\nPolitsei asus 63-aastast Anatolit rabast otsima kohe eile õhtul. Kaasati otsingukoerad, politseikopter ja droon. Telefoni Anatoli metsa kaasa ei võtnud ja seljas olid tal rohekad ülerõivad. Otsingud lõpetati pärast südaööd tulemusteta, kuid neid jätkati täna hommikul.\r\n\r\n„Politsei jätkas Anatoli otsimist täna hommikul kella 9 paiku, nagu eilegi kaasasime ka vabatahtlikud, otsingukoerad, drooni ja kopteri,“ ütles Jõhvi politseijaoskonna juht Andreas Kliimant. „Rõõm on teatada, et meie päästekopter leidis Anatoli täna kella 13 paiku.\r\n\r\nKopteri meeskond vintsis Anatoli pardale ja ta anti üle kiirabitöötajatele, kes 63-aastase öö metsas veetnud mehe üle vaatasid. Temaga on kõik hästi.\r\n\r\n„Tegu on äärmiselt õnneliku looga ja mul on väga hea meel, et see nii hästi lõppes,“ ütles Kliimant. „Samas tuletan meelde, et metsa minnes tuleb kaasa võtta täislaetud akuga telefon, võimalusel pistke tasku ka akupank ja laadimisjuhe. Kindlasti tuleb kaasa pakkida ka vett ja selga panna eredad ja silmapaistvad riided,“ rõhutas jaoskonnajuht. „Vajadusel on politseil nii võimalik teid kiiremini leida.“\r\n\r\nKliimanti sõnul peaksid ka lähedased mure korral koheselt politseid teavitama. „Tihtipeale ei taha inimesed kohe oma murega politsei poole pöörduda ja ootavad või otsivad kõigepealt lähedast oma jõududega. Need tunnid on aga olulised, eriti praegusel ajal, kui päevavalgust on vähe. Politseid tuleks hädaabinumbril 112 koheselt teavitada, kui on kahtlus, et keegi on kadunud või eksinud,“ ütles ta ja lisas, et ka metsalised ise võiksid olla tähelepanelikud ning enne hämardumist sammud kodu poole seada. „Pimedas on keerulisem leida õige suund ja isegi kõige tuttavam metsatukk võib võõraks muutuda,“ märkis Kliimant.', , 3, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(4, 'Moskva lõksu langenud Lukašenka ei lase opositsiooni rihma lõdvemaks', 'Enne eilseid valimisi said kümned Valgevene opositsiooni esindajad teada, et kahjuks on nad allkirju kogudes vigu teinud ega saa kandideerida.\r\nEile toimusid Valgevenes parlamendivalimised, mille kritiseerijad tituleerisid juba enne algust pettuseks. Peale selle nimetab opositsioon 110-kohalist Valgevene parlamendi alamkoda kõigest kummitempliks.\r\n\r\nPresident Aljaksandr Lukašenka on ametis olnud 1994. aastast saadik. Selle aja jooksul on Valgevenes toimunud hulk valimisi, mille rahvusvahelised vaatlejad on kuulutanud ebaausateks, kirjutab uudisteagentuur AFP. ', , 2, 1);

